import { Unauthorized } from "../components/Unauthorized/Unauthorized"
export async function synchronizeToken(token) {
    if (!token) {
        return <Unauthorized />
    }
    const request = await fetch('https://localhost:8080/api/token', {
        method: 'GET',
        headers: {
            'Authorization': 'Bearer ' + token
        }
    })
    if (!request.ok) {
        return <Unauthorized />
    }
}
